import "./App.css";
import { SocketContext, socket } from "./contexts/socket.js";

function App() {
  const so = socket.connect();

  return (
    <>
      <SocketContext.Provider value={socket}>
        <div className="App">
          <p>Hello World!</p>
        </div>
      </SocketContext.Provider>
    </>
  );
}

export default App;
